				</table>
				
				<div class="container" style="text-align: right;">
					${
            feature.properties.cartodb_id == 17
              ? "تعتبر بئر السبع مركز للتجارة والاتصالات بين تجار القدس والخليل وغزة والمجدل والقبائل البدوية. ويقع قضاء بئر السبع جنوب فلسطين، ويحده من الغرب قضاء غزة، ومن الشرق الأردن، وجنوب البحر الميت ووادي عربة، ومن الشمال قضاء الخليل، ومن الجنوب خليج العقبة وشبه جزيرة سيناء."
              : feature.properties.cartodb_id == 10
              ? " تعتبر أرض الخليل التي يعود تاريخها لأكثر من سبعة آلاف سنة كما يذكر المؤرخون أرضا مقدسة في الديانات الثلاث فهي تضم مقامات للكثير من الأنبياء والرسل عليهم السلام والعديد من مقامات الصحابة رضوان الله عليهم وأشهرها مقام إبراهيم الخليل في المسجد الإبراهيمي في قلب الخليل هو ما دفع الطوائف المختلفة لنسب الخليل إليها لعظم مكانة إبراهيم في الديانات الإسلامية والمسيحية واليهودية  <div align='center'><img style='width:50%;' src='https://upload.wikimedia.org/wikipedia/commons/thumb/9/90/%D9%85%D8%B3%D8%AC%D8%AF_%D8%A7%D9%84%D8%AD%D8%B1%D9%85_%D8%A7%D9%84%D8%A5%D8%A8%D8%B1%D8%A7%D9%87%D9%8A%D9%85%D9%8A_-_%D9%85%D8%AF%D9%8A%D9%86%D8%A9_%D8%A7%D9%84%D8%AE%D9%84%D9%8A%D9%84.JPG/1280px-%D9%85%D8%B3%D8%AC%D8%AF_%D8%A7%D9%84%D8%AD%D8%B1%D9%85_%D8%A7%D9%84%D8%A5%D8%A8%D8%B1%D8%A7%D9%87%D9%8A%D9%85%D9%8A_-_%D9%85%D8%AF%D9%8A%D9%86%D8%A9_%D8%A7%D9%84%D8%AE%D9%84%D9%8A%D9%84.JPG'></div>"
              : feature.properties.cartodb_id == 16
              ? "غزة مدينة ساحلية فلسطينية، وأكبر مدن قطاع غزة وتقع في شماله، في الطرف الجنوبي للساحل الشرقي من البحر المتوسط. تبعد عن مدينة القدس مسافة 78 كم إلى الجنوب الغربي، وهي مركز محافظة غزة وأكبر مدن السلطة الفلسطينية من حيث تعداد السكان، حيث بلغ عدد سكان محافظة غزة 700 ألف نسمة في عام 2013، ما يجعلها أكبر تجمع للفلسطينيين في فلسطين. تبلغ مساحتها 56 كم2، مما يجعلها من أكثر المدن كثافة بالسكان في العالم"
              : feature.properties.cartodb_id == 13
              ? "احتلت عام 1948م، وهي واحدة من المدن الكنعانية التي يعود تاريخ تأسيسها إلى حوالي 5000 عام وتعرف باسم كنية عروس البحر، وهي مدينة فلسطينية تقع في وسط الشاطئ وتربط بين مدن غزة وحيفا بالقرب من الجانب الجنوبي لنهر العوجة"
              : feature.properties.cartodb_id == 11
              ? 'احتُلت عام 1967م، ويطلق عليها اسم "بيت المقدس" وإيلياء، وهي العاصمة الوطنية والثقافية والاقتصادية والسياسية لدولة فلسطين، وقِبلة أنظار العالم حيث يوجد بها المسجد الأقصى وهو أولى القبلتين وثالث الحرمين الشريفين، وقبة الصخرة، وكنيسة القيامة، فتحها المسلمون وتسلمها الخليفة العادل عمر بن الخطّاب في العام الخامس عشر للهجرة، وأعطى لأهلها العهدة العمرية التي تعتبر مثالاً في العدل والتسامح الديني والإنساني'
              : feature.properties.cartodb_id == 3
              ? "احتُلت عام 1948م، وهي مدينة ذات موقع استراتيجي مهم، حيث تربط الشرق بالنشاط التجاري والممرات المائية، وتُعدُّ أحد المدن التاريخية المدرجة ضمن تراث اليونسكو العالمي. تحتوي مدينة عكا على عدّة أماكن تاريخية مميزة مثل: مقام النبي صالح، حدائق البهجة، سور الجزار"
              : feature.properties.cartodb_id == 14
              ? "احتُلت عام 1948م، تأسّست في العصر الأموي على يد سليمان بن عبد الملك عام 715م حيث جعلها مقرّ خلافته. وتتميّز الرملة تجارياً وحربياً كونها تُعتبر الممر الذي يصل يافا بالقدس، كان أهل الرملة في بداية تأسيسها مؤلّفين من العرب، والعجم، والسامريين، وتقدّمت الرملة مع الوقت في مختلف الميادين حتّى غدت من مدن الشام الكبرى ومركزاً لمقاطعة فلسطين، ويجدر بالذكر أنّها ظلّت عاصمةً لفلسطين نحو 400 سنة حتّى احتلّها الفرنجة عام 1099مـ"
              : feature.properties.cartodb_id == 2
              ? "احتُلت عام 1948م، وهي واحدة من المدن الواقعة على الجانب الشمالي من فلسطين، ولها موقع ساهم في جعلها نقطة سياحية وعسكرية وتجارية مهمة؛ تقع داخل المسار التجاري الذي يبدأ من دمشق ويمر عبر مدينة طبريا، ثم يعبر مجموعة من المدن مثل اللد وغزة حتى يصل إلى مصر"
              : feature.properties.cartodb_id == 8
              ? "احتُلت عام 1948م، عُرِفت منذ بداية تأسيسها في العصر الرومانيّ باسم بيرات سورقا ويقصد بها بئر كرم مختار، وقد ذكر المقريزيّ المدينة في كتاباته، حيث ذكرها باسم طوركرم؛ أي جبل الكرم، وهو الجبل المزروع بالأشجار المُثمِرة، واحتفظت المدينة بهذا الاسم حتى القرن السابع عشر الميلاديّ"
              : feature.properties.cartodb_id == 6
              ? "احتُلت عام 1967م، فتحها العرب المسلمون في القرن السابع الميلادي وعُرفت باسم جنين منذ ذلك الوقت حتّى اليوم نسبةً للجنائن التي تُحيط بها. وتتميّز بموقعٍ استراتيجي يجعلها منطقة تواصل بين عدة مدن فلسطينية، مثل: بيت شيعان ونابلس، وتحتوي على بقايا برج له قاعدة مائلة، وأساسات، وجدران، وصهاريج، وكهوف، ومدافن"
              : feature.properties.cartodb_id == 9
              ? "احتُلت عام 1967م، تعدّدت الآراء حول أصل تسمية مدينة رام الله بهذا الاسم، إلا أنّ أكثرها قرباً من الصحة هو أنّ كلمة رام هي كلمة ذات أصل كنعاني بمعنى المنطقة المرتفعة، وكلمة الله هي من إضافة العرب لتُصبح رام الله. وكانت قد تأسست في القرن السادس عشر الميلادي على يد أحد المشايخ الذي يُدعى راشد الحدادين"
              : feature.properties.cartodb_id == 12
              ? "احتُلت عام 1948م، وتُعرف باسم عروس الكرمل، وهي مدينة على ساحل البحر المتوسط، وتصنف على أنها أحد الموانئ المهمة في فلسطين، وتقع على الجانب الجنوبي من الخليج المشترك بينها وبين مدينة عكا. وقد بني قسم كبير منها على جبل الكرمل، وفيها منطقة صناعية كبيرة"
              : feature.properties.cartodb_id == 5
              ? "احتُلت عام 1948م، وتُعدّ إحدى أكبر وأجمل مدن فلسطين، ولها مكانة خاصة في نفوس المسيحيين في مختلف أنحاء العالم، حيث يحجّون إليها كما يحجّون إلى كنيسة القيامة في القدس وكنيسة المهد في بيت لحم. وتدل الحفريات الأثرية على أنّ الناصرة كانت مأهولةً بالسكان في العصر البرونزي المتوسط والعهد الحديدي، وتوالت العديد من الحضارات التي حكمت الناصرة؛ كالأمويين، والعباسيين، والصليبيين، والعثمانيين"
              : feature.properties.cartodb_id == 1
              ? "احتُلت عام 1948م، صفد أو مكبل هي مدينة جبلية فلسطينية، وتقع في الجانب الشرقي من جبال الجليل، وتتميز بمناخها وانتشار العديد من مزارع الكروم المزروعة بالعنب وأشجار الزيتون المحيطة بها"
              : feature.properties.cartodb_id == 7
              ? "احتُلت عام 1967م، تصنف على أنها واحدة من المدن العربية الكنعانية القديمة، حيث يعود تاريخ تأسيسها إلى ما يقرب من 9000 عام، وكانت تعرف في الماضي باسم شيكيم ومعناها باسم أرض مرتفعة. وكانت خلال الانتداب البريطاني ساحةً للاشتباكات المُسلّحة، ممّا تسبّب في المزيد من دمارها، وتُعتبر مدينة نابلس اليوم مركزاً تجاريّاً حيويّاً، فهي موطن لأكبر جامعة في فلسطين وهي جامعة النجاح الوطنية"
              : "احتُلت عام 1948م، وسُميت بهذا الاسم نسبة إلى كلمة بيت باليونانية القديمة، أي للإشارة إلى المعبد الذي كان قائماً بها في عهد الإمبراطورية اليونانية، قبل أن تتحول بيسان إلى مدينة كبيرة، كانت عبارة عن قرية صغيرة تمكّن الفراعنة من السيطرة عليها بسهولة، ولكنّها تعرضت لزلزال كبير أدّى إلى هروب سكانها منها، ولكن قام المماليك بإعادة تعميرها، فتحوّلت في عصرهم إلى مدينة مزدهرة، وهكذا عاش فيها العرب المسلمون، والمسيحيون حتى تمت السيطرة عليها من قبل قوات الاحتلال الصهيوني في عام 1948م"
          }
				 </div>
				 `);
        },
      }).addTo(map);

      var Occupied = L.geoJSON([occupied], { pane: "right" }).addTo(map);
      L.control.sideBySide(Occupied, Palastine).addTo(map);
    </script>
